// Importando o React
import React, { Component } from 'react';
import Header from './components/header/header';
import Main from './main';
import Welcome from './components/welcome/welcome';
import NotFount from './components/notFound/notFound';
import Callback from './components/callback/callback';

class App extends Component {
  render() {
    let mainComponent = "";
    switch (this.props.location) {
      case "":
        mainComponent = <Welcome/>;
        break;
      case "callback":
        mainComponent = <Callback/>;
        break;
      case "home":
        mainComponent = this.props.auth.isAuthenticated() ? <Main/> : <NotFount/>;
        break;
      default:
        mainComponent = <NotFount/>
    }
    return (
      <div>
        <Header name={this.props.name + " " + this.props.lastName}>
          {!this.props.auth.isAuthenticated() &&
            <button className="btnYe" onClick={this.props.auth.login}>LOGIN</button>
          }
        </Header>  
        {mainComponent}
      </div>
    );
  }
}

export default App;
